import React from 'react'
import Card from '@material-ui/core/Card'
import CardActions from '@material-ui/core/CardActions'
import CardContent from '@material-ui/core/CardContent'
import CardMedia from '@material-ui/core/CardMedia'
import Button from '@material-ui/core/Button'
import Typography from '@material-ui/core/Typography'

const Maintain = (props) => {
    console.log(props)
    return(
        <div>
            { props.maintain ? (
                <Card >
                    <CardMedia style={{height: 0, paddingTop: '56.25%'}}
                    image={props.maintain.id}
                    title={props.maintain.name}
                    />
                    <CardContent>
                    <Typography gutterBottom variant="headline" component="h2">
                        {props.maintain.description}
                    </Typography>
                    <Typography component="p">
                        {props.maintain.part_nbr}
                    </Typography>
                    <Typography component="p">
                        {props.maintain.status}
                    </Typography>
                    </CardContent>
                    <CardActions>
                    <Button size="small" color="primary" href={props.maintain.name} target="_blank">
                        Go To Maintain
                    </Button>
                    </CardActions>
                </Card>
            ) : null}
        </div>
    )
}

export default Maintain
